import React from "react";

function Header() {
  return (
    <nav className="navbar flex w-screen   p-20 pl-10 pr-10 shadow-md gap-10 bg-amber-200 justify-start items-center">
      <ul className="flex gap-5   font-bold items-center">
        <li className="pr-10 text-3xl font-black">VandyBox</li>
      </ul>
    </nav>
  );
}

export default Header;
